	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 424px; min-height: 379px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 0px; top: 0px; width: 424px; min-height: 379px;\"><p leglh=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;\" align=\"left\">\n<span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000; \"><strong>Purpose</strong></span><span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000;\">\n</span></p>\n<p leglh=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;\" align=\"left\">\n<span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000;\">This basic linear template allows learners to access chapters and pages by moving forward and backward&nbsp;only, in sequential order. An audio file placeholder is included on each page that you can replace with narration if desired\n</span></p>\n<p leglh=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;\" align=\"left\">\n<span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000;\">​\n</span></p>\n<p leglh=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;\" align=\"left\">\n<span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000; \"><strong>Title Level/Design</strong></span><span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000;\">\n</span></p>\n<p leglh=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;\" align=\"left\">\n<span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000;\">On the Design ribbon, you can change the title type, background color/image, text style, and other defaults. In the Title Explorer Header group, you\'ll find the navigation buttons as well as the FC_Logo placeholder.\n</span></p>\n<p leglh=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;\" align=\"left\">\n<span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000;\">​\n</span></p>\n<p leglh=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;\" align=\"left\">\n<span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000; \"><strong>Test</strong></span><span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000;\">\n</span></p>\n<p leglh=\"1.251\" style=\"margin-left:0px;text-indent:0px;line-height:1.199;margin-top:0px;margin-bottom:0px;\" align=\"left\">\n<span style=\" font-size:12pt; font-family:\'Arial, sans-serif\', sans-serif; color:#000000;\">When passed, navigation goes to the Test Success page. When failed or canceled, navigation goes to the Test Fail page. Remember to&nbsp;set the appropriate passing score for your title, or un-check \"Grade the test\" on the Test Results tab. \"Show Test Results\" is selected providing a results page. A certificate is also included.&nbsp;</span><span style=\" font-size:10pt; font-family:\'Arial\', sans-serif; color:#000000;\">\n</span></p>\n</div></div>",
